import React from 'react';
import Logo from '../atoms/logo';
import Dummy from '../atoms/My';
import List from '../atoms/list'

function Header() {
  return (
  <>
   <Logo/>
   <Dummy/>
   <List/>
  </>
  );
}

export default Header;
